import React, { ReactElement } from "react";
import { Link } from "react-router-dom";
import "assets/mycss/components.scss";
interface Props {
  tag: string;
  link?:
    | string
    | LocationDescriptorObject<PoorMansUnknown>
    | ((
        location: Location<PoorMansUnknown>
      ) => LocationDescriptor<PoorMansUnknown>);
}

export default function Button({ tag, link }: Props): ReactElement {
  return (
    <div>
      <button className="my--btn">
        <Link to={link}>{tag}</Link>
      </button>
    </div>
  );
}
